import React, { useState } from 'react';
import axios from 'axios';
import '../../App.css';

// NextERP API URL
const FRAPPE_BASE_URL = "https://ups-uat.sowaanerp.com";
const LOGIN_URL = `${FRAPPE_BASE_URL}/api/method/login`;
const CREATE_LEAD_URL = `${FRAPPE_BASE_URL}/api/resource/Lead`;

const USERNAME = "mraza@ups.com";
const PASSWORD = "asadraza@123";

export default function SignUp() {
  // State to hold form input values
  const [formData, setFormData] = useState({
    city: '',
    country: '',
    weight: '',
    productType: '',
    comments: ''
  });

  // Handle input changes and update state
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  // Function to log in and get session cookies
  const login = async () => {
    try {
      const response = await axios.post(
        LOGIN_URL,
        {
          usr: USERNAME,
          pwd: PASSWORD
        },
        { withCredentials: true } // Ensure cookies are stored
      );

      if (response.status === 200) {
        console.log("Login successful!");
        return response.headers['set-cookie']; // Get session cookie
      }
    } catch (error) {
      console.error("Login failed:", error.response ? error.response.data : error.message);
      return null;
    }
  };

  // Handle form submission and post to NextERP API
  const handleSubmit = async (e) => {
    e.preventDefault();

    const cookies = await login(); // Get authentication cookies
    if (!cookies) {
      alert('Login failed! Please check credentials.');
      return;
    }

    try {
      // Lead data to be sent
      const leadData = {
        doctype: "Lead",
        lead_name: formData.city, // Using city as lead name (change as needed)
        city: formData.city,
        country: formData.country,
        weight: formData.weight,
        product_type: formData.productType,
        comments: formData.comments,
        status: "Open"
      };

      // Sending form data to NextERP API
      const leadResponse = await axios.post(
        CREATE_LEAD_URL,
        leadData,
        {
          headers: {
            'Content-Type': 'application/json',
            Cookie: cookies, // Pass session cookies
          },
          withCredentials: true,
        }
      );

      console.log('Lead created successfully:', leadResponse.data);
      alert('Lead created successfully!');

      // Reset form after successful submission
      setFormData({
        city: '',
        country: '',
        weight: '',
        productType: '',
        comments: ''
      });
    } catch (error) {
      console.error('Failed to create lead:', error.response ? error.response.data : error.message);
      alert('There was an error creating the lead. Please try again.');
    }
  };

  return (
    <div className="sign-up-container">
      <h1>Request a Shipment Quote</h1>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="city">City:</label>
          <input
            type="text"
            id="city"
            name="city"
            value={formData.city}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="country">Country:</label>
          <input
            type="text"
            id="country"
            name="country"
            value={formData.country}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="weight">Weight (kg):</label>
          <input
            type="number"
            id="weight"
            name="weight"
            value={formData.weight}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="productType">Product Type:</label>
          <input
            type="text"
            id="productType"
            name="productType"
            value={formData.productType}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="comments">Comments:</label>
          <textarea
            id="comments"
            name="comments"
            value={formData.comments}
            onChange={handleChange}
          />
        </div>
        <button type="submit" className="submit-btn">Get Quote</button>
      </form>
    </div>
  );
}
